(1849, 96, 'Kendo I', '102M', 'Basic movements, history, philosophy, and concepts of the martial art of kendo.  Learning kendo through its practice.'),
(1850, 96, 'Aerobic Exercise I', '103A', 'This course is designed for beginner and intermediate aerobic students. Its purpose is to introduce theoretical and practical principles of stretching, toning, and aerobic activity that progressively improve cardiovascular strength and endurance, flexibility, co-ordination and body image.'),
(1851, 96, 'Aerobic Exercise, Low Impact', '103C', 'This course is designed for students who do not wish to participate in high impact aerobic. Its purpose is to introduce theoretical and practical principles of stretching, toning, and aerobic activity that progressively improve cardiovascular strength and endurance, flexibility, co-ordination and body image.'),
(1852, 96, 'General Conditioning I', '103D', 'This course is designed to provide students with a background in physical fitness, exercise, and health principles and practices. These principles will be applied to personal exercise and health programs through activities such as target heart rate monitoring, body measurements, posture analysis, and energy intake and expenditure assessments. The course includes lectures, demonstrations and active student participation in vigorous exercise activities.'),
(1853, 96, 'Power Walking', '103G', 'This course is designed to provide students with basic knowledge of physical fitness and healthy lifestyle principles. Power walking is a program that includes muscular strength and endurance, flexibility, cardiovascular endurance, and total body health.'),
(1854, 96, 'Weight Training I', '103R', 'This course is designed to teach basic level weight training principles, basic anatomy, and diet and nutrition. All components are designed to enhance muscular strength, endurance and flexibility. This course includes lectures, demonstrations, and active student participation.'),
(1855, 96, 'Swim Conditioning', '103S', 'This course is designed for students who want to achieve cardiovascular fitness through swimming. Student will develop muscular endurance, strength and flexibility, and cardiovascular fitness. Students will learn use several training principles and techniques such as interval training, long distance swimming and dry land exercises. Students will also learn basic nutrition and diet guidelines. Swimming I or equivalent skills are recommended.'),
(1856, 96, 'Distance Running', '103T', 'This course is designed to provide students with the basic understanding of distance running as a form of developing cardiovascular endurance and muscular strength and endurance for recreation and competition. This course will cover a variety of topics such as goal setting, designing workouts, injury awareness and prevention, training in adverse weather and environmental conditions and proper nutritional guidelines.'),
(1857, 96, 'Step Aerobics', '103U', 'This course is designed as an alternative to high impact aerobics for beginning and intermediate step students. Its purpose is to introduce theoretical and practical principles of stretching, toning, and step aerobic activity that progressively improve cardiovascular strength and endurance, flexibility, co-ordination and body image.'),
(1858, 96, 'Boxing Conditioning', '103V', 'Boxing Conditioning is an intense boxing specific conditioning program that teaches fundamentals and techniques.'),
(1859, 96, 'Bowling I', '106C', 'This course is designed to help students acquire the fundamental skills of bowling including form and technique. Students will also learn the terminology, rules, strategies and scoring procedures. The course involves lectures, demonstration, and practice time.'),
(1860, 96, 'Golf I', '106E', 'This class is designed to introduce the beginning golf student to the rules and etiquette of the game, basic swing fundamentals, and proper equipment selection. The course includes lectures, demonstrations, participation, and examinations.'),
(1861, 96, 'Self Defense', '106V', 'This course is intended to increase students awareness and understanding of sexual assault. Focus will be placed on defense against sexual violence that is most often directed towards women, and increasingly men, in our culture. Techniques for diffusing or avoiding potentially dangerous situations will be examined. Such techniques include verbal, nonverbal, physical and psychological responses. Physical self-defense skills include evasions, blocks, counterattacks and other defenses against common attacks. The concept of unlearning'),
(1862, 96, 'Yoga', '106W', 'This course will explore the beginning aspects of Yoga.'),
(1863, 96, 'Racquetball I', '107B', 'Racquetball is a vigorous racquet game played on an enclosed four-wall court with two, three, or four players. Students will learn the fundamental skills including forehand, backhand, and serve. The students will also learn basic rules, strategies, and scoring.'),
(1864, 96, 'Tennis I', '107E', 'Tennis is a racquet sport that is played on a hard surface court which is divided in half by a three foot high net. The course will introduce students to the basic strokes, footwork, and court positions to play singles and doubles. Rules, scoring and game etiquette will also be included.'),
(1865, 96, 'Basketball I', '108A', 'Basketball combines skill drills, half court scrimmages, and full court games to improve basic skills, game play, and endurance. Students will learn basic skills, rules, and basic defensive and offensive strategies.'),
(1866, 96, 'Ice Hockey I', '108C', 'This course will cover elementary hockey concepts, skills and strategies.'),
(1867, 96, 'Soccer I', '108F', 'Soccer is a team sport that utilizes a field with goals set at each end of the field. Ball contact may be made by the foot, body, and head. Students will learn the fundamental skills and tactics of outdoor soccer. Rules, scoring, and offensive and defensive strategies will be emphasized.'),
(1868, 96, 'Volleyball I', '108K', 'Students will learn the fundamental kills, rules and strategies of the game. The class involves lectures, demonstrations, drills, and game play.'),
(1869, 96, 'Softball I', '108P', 'Softball is played on an outdoor field with a softball and bat. Students will learn basic skills of throwing, fielding, hitting, and base running. Students will also learn rules, offensive and defensive strategies, and score keeping.'),
(1870, 96, 'Soccer, Indoor', '108R', 'Students will learn basic technical and tactical soccer skills specific to the indoor soccer arena. These skills will be presented through lectures, demonstrations, drills, and game play.'),
(1871, 96, 'Wheelchair Basketball', '108W', 'Fundamental wheelchair basketball skills. Team offensive and defensive concepts and strategies.'),
(1872, 96, 'Swimming II', '111A', 'This course is designed for the intermediate swimmer to refine swimming skills, learn new strokes, increase swimming fitness levels, and learn basic water safety and rescue techniques. Stroke and skill emphasis will be placed on sculling, freestyle, backstroke, breaststroke, elementary backstroke, diving, and flip turns. Students will demonstrate knowledge of propulsion and resistance forces, correct stroke technique, and safety and emergency procedures. Swimming I or equivalent skills are recommended.'),
(1873, 96, 'SCUBA Diving II', '111G', 'This advanced scuba course explores advanced scuba skills. Scuba I or equivalent skills are recommended'),
(1874, 96, 'SCUBA Open Water Certification', '111U', 'Advance Skill and knowledge development in advanced water-related activities.'),
(1875, 96, 'Karate II', '112B', 'This course is designed for the experienced Karate student. Advanced Karate skills that involve actual contest and contest strategies will be emphasized in order to assist the students in attaining a higher level of proficiency in Karate. Karate I or equivalent skills are recommended.'),
(1876, 96, 'Aerobic Exercise II', '113A', 'This course is designed for intermediate and advanced aerobic students. Its purpose is to introduce theoretical and practical principles of stretching, toning, and aerobic activity that progressively improve cardiovascular strength and endurance, flexibility, co-ordination and body image.'),
(1877, 96, 'General Conditioning II', '113B', 'This course is designed to improve cardiovascular endurance, body strength, flexibility, agility, balance, and rhythm through aerobic exercises, flexibility and resistance training programs. Extensive information on physical fitness, exercise, and health principles and practices will be provided to students. General Conditioning I or equivalent skills are recommended.'),
(1878, 96, 'General Conditioning III', '113C', 'This is a fitness course that emphasizes advanced aerobic and strength training programs. Students will learn the basic principles of these programs and learn to apply that knowledge in the form of an individualized exercise program. Competitive training techniques for both an aerobic and strength program will also be included. General Condition II or equivalent skills are recommended.'),
(1879, 96, 'Weight Training II', '113E', 'This course is designed to teach intermediate level weight training principles, basic anatomy and muscle physiology, and nutrition and diet. Students will learn different weight training programs and develop personal training programs. This course involves lectures, demonstrations, and active student participation. Weight Training I or equivalent skills are recommended.'),
(1880, 96, 'Weight Training III', '113F', 'This course is designed to teach advanced weight training techniques, principles, and programs. Students will learn strength training principles, anatomy and muscle physiology, nutrition and diet. Students will develop personalized weight training program that incorporates the principles and guidelines provided in this course. This course includes lectures, presentations, and active student participation. Weight Training II or equivalent skills are recommended.'),
