(3838, 173, 'Evolution (W)', '445', 'Research in equine exercise science. Physical, physiologic, metabolic and mental adaptation to athletic training. Nutrition and bioenergetics of muscle metabolism.'),
(3839, 173, 'Environ Issues & Pub Policy', '446', 'Deterministic and random digital signal processing theory in the context of biomedical applications with computer projects on the analysis of real physiologic signals.'),
(3840, 173, 'Limnological Techniques', '474', 'Theoretical aspects of advanced hematology, hemostasis and body fluid analysis. Integration of cognitive material with clinical laboratory test results.'),
(3841, 173, 'Tropical Biology', '485', 'Activities, functions, and organization of museums. Changing role of museums as cultural institutions.'),
(3842, 173, 'Sem in Zoo & Aquarium Science', '489', 'Integration of the subdivisions of anthropology. Differences between anthropology and other approaches in the social sciences. Future directions of anthropological inquiry.'),
(3843, 173, 'Overseas Study in Zoology', '490', 'Independent supervised study of topics in agribusiness management.'),
(3844, 173, 'Independent Study', '494', 'Theoretical and practical approaches to the planning, design, development, installation, and evaluation of museum exhibitions. Field Trip required.'),
(3845, 173, 'Undergraduate Seminar', '495', 'Focus on readings and research in the human arts and sciences. Each student works with a black American and diasporic studies faculty mentor in the student''s area of study. Training in knowledge creation, production and dissemination.'),
(3846, 173, 'Internship in Zoology', '496', 'A capstone course consisting of supervised professional experience in learning environments such as museums, zoos, botanical gardens, and historic homes.'),
(3847, 173, 'Internship Zoo & Aquarium Sci', '498', 'Theoretical and practical approaches to understanding and enhancing ways visitors experience museums, zoos, botanical gardens, and other informal learning environments.  Creating educational programs, exhibits, and media.'),
(3848, 173, 'Professional Development', '801', 'Mathematical tools in economic analysis.  Matrix algebra, derivatives, partial derivatives, optimization, integration, and linear differential equations.'),
(3849, 173, 'Mol and Dev Neurobiology', '804', 'Use of accounting information for financial planning and decision making.  Interpretation and analysis of financial statements and management accounting systems for planning, control and performance evaluation.'),
(3850, 173, 'Top Ethology & Behav Ecology', '822', 'Management of information system projects. Modeling of business processes. Management of project scope, time and costs. Planning and control of projects. Program and portfolio management. Consulting issues for effective project management.'),
(3851, 173, 'Physiol & Phrm Excitable Cells', '827', 'Economic concepts and approaches for analyzing policy decisions in community development, agriculture, natural resources management, recreation and tourism.  Case studies in non-market valuation, regional economic impact analysis, benefit-cost analysis for policy analysis.'),
(3852, 173, 'Stat Meth Ecology & Evolution', '851', 'Managerial processes for agribusiness operations control. Applications of linear programming. Budgets, simulations, and dynamic programming. Statistical process control. Predictive and prescriptive analysis.'),
(3853, 173, 'Molec Evol: Prin and Tech', '855', 'Analysis of production models using econometrics, mathematical programming, and simulation. Systems science perspective.'),
(3854, 173, 'Special Problems', '890', 'Faculty-supervised study in special topics in accounting.'),
(3855, 173, 'Seminar', '895', 'Case studies in community, agriculture, recreation and tourism, natural resources and environmental systems.  Use of multi-disciplinary teams in addressing complex policy, planning, development, and management issues.'),
(3856, 173, 'Population & Community Ecology', '896', 'Selected topics in Chicano/Latino studies.  Theories, issues, methodological innovations.'),
(3857, 173, 'Master''s Thesis Research', '899', 'Master''s thesis research.'),
(3858, 173, 'Doctoral Dissertation Research', '999', 'Doctoral dissertation research.');
